import React from 'react';

// Import the HashRouter, Route and Link components
// HashRouter is needed in order to be hosted on github
import { HashRouter, Route, Link } from 'react-router-dom';
import ScrollableAnchor from 'react-scrollable-anchor';

import Home from './Home.js';
import Projects from './Projects.js';
import Snake from './Snake.js';
import Planit from './Planit.js';
import About from './About.js';
import Contact from './Contact.js';
import Footer from './Footer.js';
import './App.css';


let backgroundStyle = {
  backgroundAttachment: 'fixed',
  backgroundSize: `100%`
};

function MainContent() {
  return (
    <div>
      <Home></Home>

      <ScrollableAnchor id={'/#projects'}>
        <div>
          <Projects/>
        </div>
      </ScrollableAnchor>

      <ScrollableAnchor id={'/#about'}>
        <div>
          <About/>
        </div>
      </ScrollableAnchor>
      <ScrollableAnchor id={'/#contact'}>
        <div>
          <Contact/>
        </div>
      </ScrollableAnchor>
    </div>
  )
}

function App() {
  return (
    <HashRouter basename='/'>
      <div className="App" style={ backgroundStyle }>
        <nav className="navbar header">
          <ul className="nav">
            <li className="nav-item">
              <Link to="/" className="item">Home</Link>
            </li>
            <li className="nav-item">
              <Link to="/#projects" className="item">Projects</Link>
            </li>
            <li className="nav-item">
              <Link to="/#about" className="item">About</Link>
            </li>

          </ul>

          <ul className="nav">
            <li>
              <a href="https://github.com/williamvennard">
                <svg className="socialIcon" aria-labelledby="simpleicons-github-icon" role="img" viewBox="0 0 25 25"><title id="simpleicons-github-icon">GitHub icon</title><path d="M12 .297c-6.63 0-12 5.373-12 12 0 5.303 3.438 9.8 8.205 11.385.6.113.82-.258.82-.577 0-.285-.01-1.04-.015-2.04-3.338.724-4.042-1.61-4.042-1.61C4.422 18.07 3.633 17.7 3.633 17.7c-1.087-.744.084-.729.084-.729 1.205.084 1.838 1.236 1.838 1.236 1.07 1.835 2.809 1.305 3.495.998.108-.776.417-1.305.76-1.605-2.665-.3-5.466-1.332-5.466-5.93 0-1.31.465-2.38 1.235-3.22-.135-.303-.54-1.523.105-3.176 0 0 1.005-.322 3.3 1.23.96-.267 1.98-.399 3-.405 1.02.006 2.04.138 3 .405 2.28-1.552 3.285-1.23 3.285-1.23.645 1.653.24 2.873.12 3.176.765.84 1.23 1.91 1.23 3.22 0 4.61-2.805 5.625-5.475 5.92.42.36.81 1.096.81 2.22 0 1.606-.015 2.896-.015 3.286 0 .315.21.69.825.57C20.565 22.092 24 17.592 24 12.297c0-6.627-5.373-12-12-12"/></svg>
              </a>
            </li>
            <li>
              <a href="https://www.linkedin.com/in/wvennard/">
                <svg className="socialIcon" aria-labelledby="simpleicons-linkedin-icon" role="img" viewBox="0 0 24 24"><title id="simpleicons-linkedin-icon">LinkedIn icon</title><path d="M20.447 20.452h-3.554v-5.569c0-1.328-.027-3.037-1.852-3.037-1.853 0-2.136 1.445-2.136 2.939v5.667H9.351V9h3.414v1.561h.046c.477-.9 1.637-1.85 3.37-1.85 3.601 0 4.267 2.37 4.267 5.455v6.286zM5.337 7.433c-1.144 0-2.063-.926-2.063-2.065 0-1.138.92-2.063 2.063-2.063 1.14 0 2.064.925 2.064 2.063 0 1.139-.925 2.065-2.064 2.065zm1.782 13.019H3.555V9h3.564v11.452zM22.225 0H1.771C.792 0 0 .774 0 1.729v20.542C0 23.227.792 24 1.771 24h20.451C23.2 24 24 23.227 24 22.271V1.729C24 .774 23.2 0 22.222 0h.003z"/></svg>
              </a>
            </li>

          </ul>
        </nav>

        <Route path="/snake"  component={ Snake } />
        <Route path="/planit"  component={ Planit } />
        <Route exact path="/"  component={ MainContent } />

        <Footer></Footer>
      </div>
    </HashRouter>
  );
}

export default App;
